    <li>
        Explanation
        <div>
            <p>
                You should use the following command:
            </p>
            <p>
                Event
                <br />
                | where (EventLevelName == ""Error"")
                <br />
                | where (TimeGenerated > ago(1days))
                <br />
                | summarize ErrorCount = count() by Computer
                <br />
                | top 10 by ErrorCount desc
            </p>
            <p>
                To create a Kusto Query Language (KQL) query that gathers the top 10 VMs with the most error events over the past day, you should start by querying the Event table. This table stores all Windows Event Log entries for associated VMs.
            </p>
            <p>
                You shoul");
            WriteLiteral(@"d not query the Heartbeat table, which logs heartbeat communications messages between Azure resources and their configured Azure Log Analytics workspace. Likewise, you should not query the Perf table, which stores Windows Performance Monitor counter data.
            </p>
            <p>
                When you use the pipe (|) character to separate multiple where clauses, you must specify the where keyword instead of the and keyword for the second and subsequent operations. You should not use the summarize keyword in line 4 because you need to summarize the query results by the ErrorCount field in line 5, not the TimeGenerated field in line 4.
            </p>
        </div>
    </li>
    <li>
        References
        <div>
            <p>
                <a href=""https://docs.microsoft.com/en-us/azure/azure-monitor/log-query/log-query-overview"" target=""_blank"" rel=""noopener"">Analyze Log Analytics data in Azure Monitor</a>
            </p>
            <p>
                <a href=""https://doc");
            WriteLiteral(@"s.microsoft.com/en-us/azure/kusto/"" target=""_blank"" rel=""noopener"">Reference</a>
            </p>
            <p>
                <a href=""https://docs.microsoft.com/en-us/azure/azure-monitor/platform/agent-windows"" target=""_blank"" rel=""noopener"">Connect Windows computers to the Log Analytics service in Azure</a>
